Looking up, into deep space... can be an extremely perspective changing experience. Looking at the 5” device in our hands, often seems like the universe is captured all in one small screen. If we take a moment to look at the much, much larger picture, beyond our phones, TVs, countries and even our planet, you begin to realize how truly special our little planet is. 
But we are destroying our planet, our people, our wildlife and nature. We have such a unique little bubble that we live in, but show very little respect for it. 
Do you think there might be other worlds looking at all the beauty on Earth with envy? Perhaps from a planet where water and oxygen are hard to find, where species are dying because of natural disasters and extreme conditions. Maybe they are thinking of coming here to escape... now fast forward, that might be us in 50-100+, years as we try and escape to Mars or further planets. 
Let’s try harder to treat each other better, and preserve the incredible planet that we call home. 
Now stop looking at this screen and go do something to make a difference!! 
