•Types—
1) Load-balancing clusters: This system is used to distribute workload across multiple installed servers in the cluster network. In an increased network usage and internet usage, load balancing acts as a key factor. Here all nodes remain integrated with all instances so that all these node entities are aware of the requests in their network. The systems do not work jointly in a solitary procedure but readdress requests separately based on a scheduler algorithm.
2) High availability (HA) clusters: These are a group of clusters which ensure to maintain very high availability.Computers from these systems are considered to be very much reliable and may not face a downtime. 
3) High performance (HP) clusters: This methodology use supercomputers and Cluster computing to solve advanced computation problems.
•Advantages—
1) Compared to highly stable and more storage mainframe computers, these systems are considered to be largely cost-efficient. 
2) The speed of processing are also equitable to the mainframe systems and other forms of supercomputers.
3) Expandability is the next key advantage of these clustered systems because they instantiate the opportunity to add any number of additional resources or systems to the existing computer network.
4) Computers face failure very often. Failure of one of the currently active nodes may be passed on to the other live nodes and on receiving this message the other set of the node will operate as a proxy for the dead node. So this ensures enhanced availability of these systems.
